var sandbox = configuration['twilio.sandbox'];
var conf =configuration['username'];
var path = `/${conf}/AvailablePhoneNumbers.json`;
var query={};
if(sandbox === 'false'){
	done({
		"request_vendor_path":path,
	     "request_vendor_method":"GET",

	})
}else
{
	path =`/${conf}/IncomingPhoneNumbers.json`;

	done({
		"request_vendor_path":path,
	    "request_vendor_method":"POST",
	    "request_vendor_parameters":query,
	    "request_vendor_headers": {
	    	"Content-Type":"application/x-www-form-urlencoded"
	    }
	})

}

var path = request_vendor_path;

var expressionQuery = request_expression;

// if we don't have a WHERE query, then return GET List path, don't do anything
if (!expressionQuery || path.includes('?')) {
 done({
 	"request_vendor_path": path
 });
}
var filterString = '?';
for (var i = 0; i < expressionQuery.length; i++) {
 var key = expressionQuery[i].attribute;
 var operator = expressionQuery[i].operator;
 var value = expressionQuery[i].value;

 filterString += key + operator + value;
 filterString += expressionQuery.length - 1 === i ? "" : "&";

}

path += encodeURI(filterString);

done({
 "request_vendor_path": path
});

if(response_iserror) {
 var body = JSON.parse(response_body_raw);
 let resp_string = "";
 for (var key in body) {
 resp_string += key + ' - ' + body[key] + ', '
 }
 var errorMessage = resp_string.slice(0, -2);
 done({
 "response_body_raw": errorMessage
 });
} else {
 done({
 "continue": true
 });
}

if (!response_iserror) {
  var response = {};
  response['endpoint'] = 'twiliov2';
  response['dateTime'] = new Date();
  response['valid'] = true;
  done({
  	"response_body": response
  });
}

done({
  "response_body": "response",
"continue":true
})
